        <Table>
          <TableHead>
            <TableRow>
              <TableCell><strong>Medicine</strong></TableCell>
              <TableCell><strong>Quantity</strong></TableCell>
              <TableCell><strong>Buyer</strong></TableCell>
              <TableCell><strong>Date</strong></TableCell>
